    .then(response =>{
        console.log(response)
    })
    .catch(error => {
        console.log(error)
    })


    return (
        <Link to="/" onClick={props.logout} ><input type="button" class="w3-center w3-hide-small" value="Logout"></input></Link>
    );
}

export default ButtonLogout;
